CBRE HOTELS ON BEHALF OF RECEIVERS AND MANAGERS ('RECEIVERS') OF FINESSER PTY LIMITED (RECEIVERS AND MANAGERS APPOINTED) ('SELLER') IS PLEASED TO PRESENT FOR SALE KARRATHA MOTEL, KARRATHA, WA.

Karratha Motel incorporates 42 accommodation rooms developed over a 2,252 sqm site boasting 3 street frontages, which is being sold as a Walk in Walk Out, Going Concern interest.

Highlights of the property include:

- Excellent location in an establish residential area, within 3.5km of the Karratha Town Centre;
- Includes a single level, functional and well maintained 42 room motel with two courtyards, barbeques, bitumen paved car parking and landscaped gardens;
- Zoned "Commercial" providing for a range of uses;
- A population of approximately 16,500* persons in Karratha, being the administrative centre of the West Pilbara region. *Source: Census 2011.

Under instructions from KPMG (Receivers and Managers appointed) Offers to Purchase close Thursday 21st April 2016 at 2.00pm (if not sold prior) at the offices of CBRE Perth.

*approx

CBRE ON BEHALF OF THE LIQUIDATORS OF STONAM PTY LTD ATF KARMINE UNIT TRUST (IN LIQUIDATION) ('SELLER') IS PLEASED TO PRESENT FOR SALE VARIOUS UNITS AT THE KARRATHA DUNES APARTMENTS, KARRATHA, WA.

Karratha Dunes Apartments incorporates 44 strata titled bedsit apartments, of which 28 are being sold 'in-one-line'.

Highlights of the property include:

- Excellent beachfront location in an established residential area within approximately 3.5 kilometres of the Karratha town centre;
- Includes 28 strata titled apartments, of approximately 32sqm each incorporating self-contained bedsit accommodation with balcony or courtyard, storage unit and one car bay each;
- Located within a two level, functional and well maintained 44 apartment complex constructed circa 2011 with a pool, barbeque area, bitumen paved car parking and landscaped gardens;

We believe it's ideal timing to acquire and grow the Various Units in Karratha Dunes Apartments which benefit from being within close proximity to the Karratha Town Centre.  Located on the beachfront, these apartments provide a modern, functional and low maintenance investment.  In addition, the strata titled nature of the property could afford any buyer further sell-down options in the future. We recommend your serious consideration of this offering.

Under instructions from the Liquidators, John Bumbak and Cliff Rocke of KordaMentha, Offers to Purchase close Wednesday 14th December 2016 at 2.00pm at the offices of CBRE Perth.

For more information, please contact the exclusive sales and marketing agent, CBRE.
